  false,\n\t\"url\": null,\n\t\"notes\": \"Chlorophyll data from NOAA's Global Change
  Expedition in July-September 1988 was submitted by Dr. D.W. Frazel of RSMAS (University
  of Miami). The expedition was conducted aboard the Mt. Mitchell in four legs covering
  the North Atlantic. Parameters included in this data set are: salinity, temperature,
  chlorophyll a, total pigment and primary productivity. Chlorophyll-a and primary
  productivity data were collected from thirty-four stations. The NOAA data report
  ERL AOML-15 is included in the documentation.nnNutrient/pigment data associated
  with the July-September 1988 Global Change Expedition are filed under NODC Accession
  #9000187; Reference # L01140.These data were \"Processed\" by OCL as of Jan 22,
  1995.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
